import React from 'react';

function Card(props){
    
    return(
        <>
        <div className="col">
            <div className="card">
            <img src={props.images}  className="card-img-top" height="200px"/>
            <div className="card-body">
                <h5 className="card-title">{props.title}</h5>
                <p className="card-text">Some quick example text to build 
                    on the card and make up the bulk of the card's content</p>
                <a href={props.links} class="btn btn-primary">{props.name}</a>
            </div>
            </div>
            </div>
        </>
    );
}

export default Card;
